syntax = "proto3";
option csharp_namespace = "Common.Protobuf";

option java_package = "catgirl.kirara.moe";

import "InstableSprayTeamInfo.proto";

// Name: BJAEMIHEOIB
message InstableSprayStageInfo {
    uint32 max_score = 13;
    bool is_finished = 4;
    uint32 stage_id = 15;
    repeated InstableSprayTeamInfo team_info_list = 10;
}

